{"compiler":{"version":"0.8.9+commit.e5eed63a"},"language":"Solidity","output":{"abi":[{"anonymous":false,"inputs":[{"indexed":false,"internalType":"string[]","name":"","type":"string[]"},{"indexed":false,"internalType":"string","name":"","type":"string"}],"name":"RevokeConsent","type":"event"},{"inputs":[{"internalType":"string","name":"_dataOfferingId","type":"string"},{"internalType":"string","name":"_consentSubject","type":"string"}],"name":"checkConsentStatus","outputs":[{"internalType":"enum ExplicitUserConsent.ConsentStatus[]","name":"","type":"uint8[]"}],"stateMutability":"view","type":"function"},{"inputs":[{"internalType":"string","name":"_dataOfferingId","type":"string"},{"internalType":"string","name":"_consentSubject","type":"string"},{"internalType":"string","name":"_consentFormHash","type":"string"},{"internalType":"uint256","name":"startDate","type":"uint256"},{"internalType":"uint256","name":"endDate","type":"uint256"}],"name":"giveConsent","outputs":[],"stateMutability":"nonpayable","type":"function"},{"inputs":[{"internalType":"address","name":"_addr","type":"address"},{"internalType":"string","name":"_dataOfferingId","type":"string"},{"internalType":"string[]","name":"_consentSubjects","type":"string[]"}],"name":"revokeConsent","outputs":[],"stateMutability":"nonpayable","type":"function"}],"devdoc":{"kind":"dev","methods":{},"version":1},"userdoc":{"kind":"user","methods":{},"version":1}},"settings":{"compilationTarget":{"contracts/ExplicitUserConsent.sol":"ExplicitUserConsent"},"evmVersion":"london","libraries":{},"metadata":{"bytecodeHash":"ipfs","useLiteralContent":true},"optimizer":{"enabled":true,"runs":500},"remappings":[]},"sources":{"contracts/Agreement.sol":{"content":"// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.0;

import "hardhat/console.sol";

enum State {
    Created,
    Active,
    Updated,
    Violated,
    Terminated
}

struct Agreement {
    uint256 agreementId;
    string providerPublicKey;
    string consumerPublicKey;
    string dataExchangeAgreementHash;
    DataOffering dataOffering;
    string purpose;
    State state;
    uint256[3] agreementDates;
    Obligation obligation;
    IntendedUse intendedUse;
    LicenseGrant licenseGrant;
    TypeOfData typeOfData;
    PricingModel pricingModel;
    Violation violation;
}

struct TypeOfData {
    bool dataStream;
    bool personalData;
}

struct DataOffering {
    string dataOfferingId;
    uint256 dataOfferingVersion;
    string title;
}

  struct Obligation {
    uint256 qualityOfData;
    string characteristics;
    bool dataAvailability;
}

struct IntendedUse {
    bool processData;
    bool shareDataWithThirdParty;
    bool editData;
}

struct LicenseGrant {
    bool copyData;
    bool transferable;
    bool exclusiveness;
    bool revocable;
}

struct PricingModel {
    string paymentType;
    uint256 price;
    string currency;
    uint256 fee;
    PaymentOnSubscription paymentOnSubscription;
    bool isFree;
}

struct PaymentOnSubscription {
    string timeDuration;
    string repeat;
}

enum ViolationType {
    NotViolated,
    PaymentNotCompleted,
    DataNotTransferredAsDescribed,
    DataNotAsDescribed,
    LicenseViolated
}

struct Violation {
    ViolationType violationType;
    string issuerId;
    string[3] penaltyChoices;
    // string chosenPenalty; 
}

struct Counter {
    uint256 activeAgreementCount;
    mapping (string => uint) providerCount;
    mapping (string => uint) providerActiveCount;
    mapping (string => uint) consumerCount;
    mapping (string => uint) consumerActiveCount;
    mapping (string => uint) dataOfferingCount;
}

struct SignedResolution {
    string proofType;
    string resolutionType;
    string resolution;
    string dataExchangeId;
    uint256 iat;
    string iss;
    string sub;
}

library AgreementViolationLibrary {

    event PenaltyTerminate(string providerPublicKey, string consumerPublicKey, uint256 id);
    event PenaltyNewEndDate(string providerPublicKey, string consumerPublicKey, uint256 id, uint256 newEndDate);
    event PenaltyNewEndDateAndPricing(string providerPublicKey, string consumerPublicKey, uint256 id, uint256 newEndDate, uint256 price, uint256 fee);
    event PenaltyChoices(string[3] penaltyChoices);

    function evaluateResolution(
        Agreement storage agreement,
        string memory _proofType,
        string memory _type,
        string memory _resolution,
        string memory _dataExchangeId,
        uint256 _iat,
        string memory _iss,
        string memory _sub) public{ 

        SignedResolution memory signedResolution;
        signedResolution.proofType = _proofType;
        signedResolution.resolutionType = _type;
        signedResolution.resolution = _resolution;
        signedResolution.dataExchangeId = _dataExchangeId;
        signedResolution.iat = _iat;
        signedResolution.iss = _iss;   
        signedResolution.sub = _sub;

        if(keccak256(abi.encodePacked(signedResolution.resolution)) == keccak256(abi.encodePacked("completed"))){
            delete agreement.violation.penaltyChoices;   
            agreement.state = State.Active;   
        }
        else if(keccak256(abi.encodePacked(signedResolution.resolution)) == keccak256(abi.encodePacked("notCompleted"))) { 
                issueViolation(agreement, ViolationType.DataNotTransferredAsDescribed, signedResolution.sub); 
                agreement.state = State.Violated; 
        }
        else if(keccak256(abi.encodePacked(signedResolution.resolution)) == keccak256(abi.encodePacked("accepted"))){ 
                issueViolation(agreement, ViolationType.DataNotTransferredAsDescribed, signedResolution.sub); 
                agreement.state = State.Violated; 
             }
        else if(keccak256(abi.encodePacked(signedResolution.resolution)) == keccak256(abi.encodePacked("denied"))){
                delete agreement.violation.penaltyChoices;  
                agreement.state = State.Active; 
        }

        emit PenaltyChoices(agreement.violation.penaltyChoices);
    }

    
    function issueViolation(Agreement storage agreement, ViolationType _violationType, string memory _issuerId) private {
        agreement.violation = Violation(_violationType, _issuerId, ["Terminate", "NewEndDateForAgreement", "NewEndDateForAgreementAndReductionOfPayment"]);
    }

     function getViolation(Agreement storage agreement) public view returns (Violation memory){
        return agreement.violation;
    }
   
    function enforcePenalty (Agreement storage agreement, string memory _chosenPenalty, uint256 _price, uint256 _fee, uint256 _newEndDate) public {
        if(agreement.violation.violationType == ViolationType.DataNotTransferredAsDescribed){
                if (keccak256(abi.encodePacked(_chosenPenalty)) == "NewEndDateForAgreement"){
                    require(_newEndDate>block.timestamp, "Date must be greaten than block.timestamp");
                    agreement.agreementDates[2] = _newEndDate;
                    emit PenaltyNewEndDate(agreement.providerPublicKey, agreement.consumerPublicKey, agreement.agreementId, _newEndDate);
                }
                else if (keccak256(abi.encodePacked(_chosenPenalty)) == (keccak256(abi.encodePacked("NewEndDateForAgreementAndReductionOfPayment")))){
                    require(_newEndDate>block.timestamp, "Date must be greaten than block.timestamp");
                    agreement.agreementDates[2] = _newEndDate;
                    agreement.pricingModel.price = _price;
                    agreement.pricingModel.fee = _fee;
                    emit PenaltyNewEndDateAndPricing(agreement.providerPublicKey, agreement.consumerPublicKey, agreement.agreementId, _newEndDate,_price, _fee);
                }
            agreement.state = State.Active;
        }    

    }
}
    
library AgreementLib {

    event AgreementTerminated(string providerPublicKey, string consumerPublicKey,uint256 id);

    function createAgreement(
        string memory _providerPublicKey,
        string memory _consumerPublicKey,
        string memory _dataExchangeAgreementHash,
        DataOffering memory dataOffering,
        string memory _purpose,
        uint256[] memory dates,
        Obligation memory obligation,
        IntendedUse memory intendedUse,
        LicenseGrant memory licenseGrant,
        PricingModel memory pricingModel,
        TypeOfData memory typeOfData,
        Counter storage counter
    ) internal returns (Agreement memory agreement)
    {
        agreement.providerPublicKey = _providerPublicKey;
        agreement.consumerPublicKey = _consumerPublicKey;
        agreement.dataExchangeAgreementHash = _dataExchangeAgreementHash;
        agreement.dataOffering.dataOfferingId = dataOffering.dataOfferingId;
        agreement.dataOffering.dataOfferingVersion = dataOffering.dataOfferingVersion;
        agreement.dataOffering.title = dataOffering.title;
        agreement.purpose = _purpose;

        agreement.state = State.Created;
        agreement.agreementDates[0] = dates[0];
        agreement.agreementDates[1] = dates[1];

        require(
            dates[1] >= agreement.agreementDates[0],
            "Start date must be after creation date."
        );
        require(dates[2] > dates[1], "End date must be after start date.");
        agreement.agreementDates[2] = dates[2];
        agreement.obligation = obligation;
        agreement.intendedUse = intendedUse;
        agreement.licenseGrant = licenseGrant;
        agreement.pricingModel = pricingModel;

        agreement.typeOfData.dataStream = typeOfData.dataStream;
        agreement.typeOfData.personalData = typeOfData.personalData;

        counter.providerCount[_providerPublicKey]++;
        counter.consumerCount[_consumerPublicKey]++; 
        counter.dataOfferingCount[dataOffering.dataOfferingId]++;
    
    }

    function signAgreement(Agreement[] storage agreements, uint256 _id, string memory _consumerPublicKey, Counter storage counter) public {
        
        require (keccak256(abi.encodePacked(agreements[_id].consumerPublicKey)) == keccak256(abi.encodePacked(_consumerPublicKey)), "Not the consumer of agreement." );

        if(agreements[_id].agreementDates[2]>=block.timestamp) {
            agreements[_id].state = State.Active;
            counter.activeAgreementCount += 1;
            counter.providerActiveCount[agreements[_id].providerPublicKey]++;
            counter.consumerActiveCount[_consumerPublicKey]++;
        }
    }

    function updateAgreement(Agreement storage agreement,
                            string memory _providerPublicKey,
                            string memory _consumerPublicKey,
                            string memory _dataOfferingId,
                            string memory _purpose,
                            uint256[] memory dates,   
                            Obligation memory obligation,
                            IntendedUse memory intendedUse,
                            LicenseGrant memory licenseGrant,
                            TypeOfData memory typeOfData,
                            Counter storage counter) public {

        require (keccak256(abi.encodePacked(agreement.providerPublicKey)) == keccak256(abi.encodePacked(_providerPublicKey)), "Not the provider of the agreement" ); 
        
        if(agreement.state == State.Active)
        {
            agreement.purpose = _purpose;
            agreement.agreementDates[1] = dates[0];
     
            require ( dates[0] >= agreement.agreementDates[0], "Start date must be after creation date." );
            require ( dates[1] > dates[0], "End date must be after start date." );
            agreement.agreementDates[2] = dates[1];

            agreement.obligation = obligation;
            agreement.intendedUse = intendedUse;
            agreement.licenseGrant = licenseGrant;
            agreement.state = State.Updated;

            counter.activeAgreementCount--;
            counter.providerActiveCount[_providerPublicKey]--;
            counter.consumerActiveCount[_consumerPublicKey]--;

        }
    }

    function terminateAgreement(Agreement storage agreement, string memory _chosenPenalty, Counter storage counter) public {
        if(agreement.agreementDates[2]<=block.timestamp || keccak256(abi.encodePacked(_chosenPenalty)) == keccak256(abi.encodePacked("Terminate"))){
            if(agreement.state == State.Active){
                counter.activeAgreementCount--;
                counter.providerCount[agreement.providerPublicKey]--;
                counter.consumerActiveCount[agreement.consumerPublicKey]--;
            }     
            agreement.state = State.Terminated;
            emit AgreementTerminated(agreement.providerPublicKey, agreement.consumerPublicKey, agreement.agreementId);
        }
    }

    
}

library RetrieveAgreementsLibrary {

    function checkActiveAgreements (Agreement[] storage agreements, Counter storage counter) external view returns (Agreement[] memory) {
        Agreement[] memory activeAgreements = new Agreement[](counter.activeAgreementCount); 
        uint k = 0;
        for (uint i = 0; i < agreements.length; i++){
            if(agreements[i].state == State.Active) {   
                activeAgreements[k++] = agreements[i];
            }
        }
        return activeAgreements;
    }

    
    function checkAgreementsByConsumer(Agreement[] storage agreements, string memory _consumerPublicKey, bool active, Counter storage counter) external view returns (Agreement[] memory) {
        uint256 k = 0;
        Agreement[] memory consumerAgreements;
        if(active) {
            consumerAgreements = new Agreement[](counter.consumerActiveCount[_consumerPublicKey]); 
            for (uint i = 0; i < agreements.length; i++)
                if (agreements[i].state == State.Active && keccak256(abi.encodePacked(agreements[i].consumerPublicKey)) == keccak256(abi.encodePacked(_consumerPublicKey))){
                    consumerAgreements[k++] = agreements[i];
                }  
        }
        else {
            consumerAgreements = new Agreement[](counter.consumerCount[_consumerPublicKey]);
            for (uint i = 0; i < agreements.length; i++)
                if (keccak256(abi.encodePacked(agreements[i].consumerPublicKey)) == keccak256(abi.encodePacked(_consumerPublicKey))){
                    consumerAgreements[k++] = agreements[i];
                }
        }
        return consumerAgreements;
    }

    function checkAgreementsByProvider (Agreement[] storage agreements, string memory _providerPublicKey, bool active, Counter storage counter) external view returns (Agreement[] memory) {
        uint256 k = 0;
        Agreement[] memory providerAgreements;
        if(active) {
            providerAgreements = new Agreement[](counter.providerActiveCount[_providerPublicKey]);
            for (uint i = 0; i < agreements.length; i++)
                if (agreements[i].state == State.Active && keccak256(abi.encodePacked(agreements[i].providerPublicKey)) == keccak256(abi.encodePacked(_providerPublicKey))){
                    providerAgreements[k++] = agreements[i];
                }  
        }
        else {
            providerAgreements = new Agreement[](counter.providerCount[_providerPublicKey]);
            for (uint i = 0; i < agreements.length; i++)
                if (keccak256(abi.encodePacked(agreements[i].providerPublicKey)) == keccak256(abi.encodePacked(_providerPublicKey))){
                    providerAgreements[k++] = agreements[i];
                }
        }
        return providerAgreements;
    }


    function checkAgreementsByDataOffering (Agreement[] storage agreements, string memory _dataOffering, Counter storage counter) external view returns (Agreement[] memory) {
        Agreement[] memory dataOfferingAgreements = new Agreement[](counter.dataOfferingCount[_dataOffering]);
        uint k = 0;
        for (uint i = 0; i < agreements.length; i++){
            if (keccak256(abi.encodePacked(agreements[i].dataOffering.dataOfferingId)) == keccak256(abi.encodePacked(_dataOffering))) {
                dataOfferingAgreements[k++] = agreements[i];
            }
        }
        return dataOfferingAgreements;
    }

      
    function retrieveAgreements (Agreement[] storage agreements, string memory _consumerPublicKey, Counter storage counter) external view returns (Agreement[] memory, uint256 k) {

        Agreement[] memory consumerPublicKeyAgreements = new Agreement[](counter.consumerActiveCount[_consumerPublicKey]);
     
        for (uint i = 0; i < agreements.length; i++){
            if (agreements[i].state == State.Active && agreements[i].agreementDates[1]<=block.timestamp && keccak256(abi.encodePacked(agreements[i].consumerPublicKey)) == keccak256(abi.encodePacked(_consumerPublicKey))) {
                consumerPublicKeyAgreements[k++] = agreements[i];
            }
        }
        return (consumerPublicKeyAgreements, k);
    }
}

contract DataSharingAgreement {

    using AgreementLib for Agreement;

    using AgreementLib for Counter;
    
    using RetrieveAgreementsLibrary for Agreement;
    
    using AgreementViolationLibrary for Agreement;

    Counter counter;

    Agreement[] public agreements;

    mapping(uint256 => string[]) agreementIdToPenalties;   

    event AgreementCreated(string providerPublicKey, string consumerPublicKey, uint256 id);
    event AgreementUpdated(string providerPublicKey, string consumerPublicKey, uint256 id);
    event AgreementSigned(string providerPublicKey, string consumerPublicKey, uint256 id);
    event SignedResolutionEvaluated(string providerPublicKey, string consumerPublicKey, uint256 id, string[] penalties);
    event ConsentRevoked(string consumerPublicKey); 

    function createAgreement(
        string memory _providerPublicKey,
        string memory _consumerPublicKey,
        string memory _dataExchangeAgreementHash,
        DataOffering memory dataOffering,
        string memory _purpose,
        uint256[] memory dates,
        Obligation memory obligation,
        IntendedUse memory intendedUse,
        LicenseGrant memory licenseGrant,
        PricingModel memory pricingModel,
        TypeOfData memory typeOfData
    ) public {
        Agreement memory agreement = AgreementLib.createAgreement(
            _providerPublicKey,
            _consumerPublicKey,
            _dataExchangeAgreementHash,
            dataOffering,
            _purpose,
            dates,
            obligation,
            intendedUse,
            licenseGrant,
            pricingModel,
            typeOfData,
            counter
        );
        agreement.agreementId = agreements.length;
        agreements.push(agreement);
        emit AgreementCreated(_providerPublicKey, _consumerPublicKey, agreements.length - 1);
    }

    function signAgreement(uint256 _id, string memory _consumerPublicKey) public {
       AgreementLib.signAgreement(agreements, _id, _consumerPublicKey, counter);
       emit AgreementSigned(agreements[_id].providerPublicKey, _consumerPublicKey, _id);
    }

     function updateAgreement(uint256 _id,
                            string memory _providerPublicKey,
                            string memory _consumerPublicKey,
                            string memory _dataOfferingId,
                            string memory _purpose,
                            uint256[] memory dates,
                            Obligation memory obligation,
                            IntendedUse memory intendedUse,
                            LicenseGrant memory licenseGrant,
                            TypeOfData memory typeOfData) public {

        AgreementLib.updateAgreement(agreements[_id], _providerPublicKey, _consumerPublicKey, _dataOfferingId, _purpose,
                            dates, obligation, intendedUse, licenseGrant, typeOfData, counter);    
        emit AgreementUpdated(_providerPublicKey, _consumerPublicKey, _id);
                            
    }

    function getAgreement(uint256 id) public view returns (Agreement memory) {
        return agreements[id];
    }

    function getAgreementsLength() public view returns (uint256) {
        return agreements.length;
    } 

    function getState(uint256 id) public view returns (State) {
        return agreements[id].state;
    } 

    function checkActiveAgreements() public view returns(Agreement[] memory) {
        Agreement[] memory activeAgreements = RetrieveAgreementsLibrary.checkActiveAgreements(agreements, counter);
        return activeAgreements;
    }

    function checkAgreementsByProvider(string memory _providerPublicKey, bool active) public view returns(Agreement[] memory) {
        Agreement[] memory agreementsByProvider = RetrieveAgreementsLibrary.checkAgreementsByProvider(agreements, _providerPublicKey, active, counter);
        return agreementsByProvider;
    }

    function checkAgreementsByConsumer(string memory _consumerPublicKey, bool active) public view returns(Agreement[] memory) {
        Agreement[] memory agreementsByConsumer = RetrieveAgreementsLibrary.checkAgreementsByConsumer(agreements,_consumerPublicKey, active, counter);
        return agreementsByConsumer;
    }

     function checkAgreementsByDataOffering(string memory _dataOfferingId) public view returns(Agreement[] memory) {
        Agreement[] memory agreementsByDataOffering = RetrieveAgreementsLibrary.checkAgreementsByDataOffering(agreements,_dataOfferingId, counter);
        return agreementsByDataOffering;
    }

    function retrieveAgreements(string memory _consumerPublicKey) external view returns (Agreement[] memory, uint256 k) {
        return RetrieveAgreementsLibrary.retrieveAgreements(agreements,_consumerPublicKey, counter);
    }

    function evaluateSignedResolution(uint256 _agreementId, string memory _proofType, string memory _type, string memory _resolution,
                                string memory _dataExchangeId, uint256 _iat, string memory _iss, string memory _sub) public{ 

      AgreementViolationLibrary.evaluateResolution(agreements[_agreementId], _proofType, _type, _resolution, _dataExchangeId, _iat, _iss, _sub);
	}

    function retrievePricingModel(uint256 _agreementId) public view returns (PricingModel memory){
        return agreements[_agreementId].pricingModel;
    }

    function terminateAgreement(uint256 _agreementId, string memory _chosenPenalty) public{ 
      AgreementLib.terminateAgreement(agreements[_agreementId],_chosenPenalty, counter);
	}

    function enforcePenalty ( uint256 _id, string memory _chosenPenalty, uint256 _price, uint256 _fee, uint256 _newEndDate) public {
        require((agreements[_id].state == State.Violated), "Agreement must be violated in order to enforce penalty");
        if(keccak256(abi.encodePacked(_chosenPenalty)) == keccak256(abi.encodePacked("Terminate"))){
            terminateAgreement(_id, _chosenPenalty);
        }
        else{
            AgreementViolationLibrary.enforcePenalty (agreements[_id], _chosenPenalty, _price, _fee, _newEndDate);
        }
    }

    function notifyConsentRevoked( string memory _dataOfferingId) public view returns (string[] memory) {    
        string[] memory consumers = new string[](counter.dataOfferingCount[_dataOfferingId]); 
        uint256 k = 0; 
        for (uint i = 0; i < agreements.length; i++){
            if (keccak256(abi.encodePacked(agreements[i].dataOffering.dataOfferingId)) == keccak256(abi.encodePacked(_dataOfferingId))) {
                consumers[k++]=agreements[i].consumerPublicKey; 
            }
        }
        return consumers;
    }

   

}
